from sympy import E
def ispal(s): return all(s[i] == s[-1-i] for i in range(len(s)//2))
def aupto(maxdigs):
    digits_e = str(E.n(maxdigs+4))[2:]
    return [int(s) for s in (digits_e[j:k+1] for k in range(1, maxdigs)
        for j in range(k)) if s[0] != '0' and ispal(s)]
